              <p style="box-sizing: border-box; border: 0px; margin: 0px 0px 10px; padding: 0px; direction: ltr; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; line-height: 18px; text-rendering: optimizeLegibility; color: rgb(0, 0, 0);">Before you submit a FOIA request, please search the Securities and Exchange Commission&rsquo;s website:</p>

              <ul style="box-sizing: border-box; border: 0px; margin: 0px 0px 18px; padding-right: 0px; padding-left: 36px; direction: ltr; line-height: 18px; list-style-position: outside; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);">
                              <li style="box-sizing: border-box; border: 0px; margin: 9px 0px; padding: 0px; direction: ltr;">Company filings can be searched on&nbsp;<a href="http://www.sec.gov/edgar/searchedgar/companysearch.html" style="box-sizing: border-box; border: 0px; margin: 0px; padding: 0px; color: rgb(0, 0, 153); text-decoration: none; line-height: inherit; background: transparent;">EDGAR</a></li>
                              <li style="box-sizing: border-box; border: 0px; margin: 9px 0px; padding: 0px; direction: ltr;">SEC decisions and releases, staff manuals, no-action and interpretive letters, and public comments on proposed rules, can be viewed and printed for free by using the&nbsp;<a href="http://www.sec.gov/search/search.htm" style="box-sizing: border-box; border: 0px; margin: 0px; padding: 0px; color: rgb(0, 0, 153); text-decoration: none; line-height: inherit; background: transparent;">on-line search feature</a></li>
                              <li style="box-sizing: border-box; border: 0px; margin: 9px 0px; padding: 0px; direction: ltr;">If you cannot locate a document, use the&nbsp;<a href="https://www.sec.gov/forms/request_public_docs" style="box-sizing: border-box; border: 0px; margin: 0px; padding: 0px; color: rgb(0, 0, 153); text-decoration: none; line-height: inherit; background: transparent;">online FOIA request form</a></li>
              </ul>

              <form accept-charset="UTF-8" action="https://public.govdelivery.com/accounts/USSEC/subscribers/qualify" class="clearfix" id="subscribe-form" method="post">
              <fieldset> <p style="text-align:center;"><span style="font-size:11px"> <img alt="Email Subscription" src="//www.sec.gov/ecms/images/govDeliveryIcon.png"> <strong> E-mail Updates: </strong> To sign up for updates, please enter your e-mail address below. </span></p>
              <p style="text-align:center;">  
              <input id="gov-delivery-box" name="email" size="40" title="Email address" type="text" placeholder="E-mail Address"> 
              <input id="topic_id" name="topic_id" type="hidden" value="USSEC_219"> <input name="subscription_type" type="hidden" value="email"> 
              <input class="buttonSmall" id="gov-delivery-submit" name="commit" onclick="_gaq.push(['_trackEvent', 'OCIE Announcements', 'Subscribe']);" title="Submit" type="submit" value="Submit"></p></fieldset>
              </form>




              <div class="show-for-print hide-for-small">
                <div id="formgrid" class="header formgrid" style="min-height: 30px;">
